import React from "react";
import "./index.scss"

import bannerImg from "../../../../../../Image/learn-creator-challenge-banner.png";

function CreatorChallenge(props) {
  return  (
    <div className="creator-challenge">
      <img className="creator-challenge_image" src={bannerImg} alt="banner"/>
      <button
        className="popup_button"
        onClick={() => {
          window.open("/challenge", "_blank");
          if (props.dismiss) props.dismiss();
        }}
      >
        도전하기
      </button>
    </div>
  );
}

export default CreatorChallenge;
